export class User {
    id : string;
    name : string;
    surname : string;
    email? : string;
    birthDate? : string;
    phoneNumber? : string;
    // role : Role;

    constructor() {
        this.id = "",
        this.name = "",
        this.surname = "",
        this.email = "",
        this.birthDate = "",
        this.phoneNumber = ""
    }
}
